import React from 'react'

const Postapi = () => {

  return (
    <>
    <h1>Post api</h1>
    <input type="text" name="name"/><br/><br/>
    <input type="text" name="class"/><br/><br/>
    <input type="text" name="city"/><br/><br/>
    <button type="button">Save</button>
    </>
  )
}

export default Postapi
